// BACKGROUND

import city from "./B_City.png";
import desert from "./B_Desert.png";
import sea from "./B_Sea.png";
import forest from "./B_Forest.png";

//FLOWER

import rose from "./F_Rose.png";
import lilac from "./F_Lilac.png";
import daisy from "./F_Daisy.png";
import blackhole from "./F_Blackhole.png";

// STEM

import gold from "./S_Gold.png";
import crystal from "./S_Crystal.png";
import stick from "./S_Stick.png";
import green from "./S_Stem.png";

// ADDONS

import spikes from "./M_Spikes.png";
import thorns from "./M_Thorns.png";
import leaves from "./M_Leaves.png";
import tentacles from "./M_Tentacles.png";

// FIX

import frame from "./Frame.png";

export {
    frame,
    city,desert,sea, forest,
    rose, lilac, daisy, blackhole,
    gold, crystal, stick, green,
    spikes, thorns, leaves, tentacles
};
